import styled from 'styled-components'

const Outer = styled.div`
    padding-top: 10px;
    font-family: Roboto;

    #intro {
        margin-top: 5px;
        margin-left: 38%;
    }

    h4 {
        align: center;
        text-align: center;
        width: 42%;
        word-wrap: break-word;
    }

    img {
        margin-top: 10px;
        border-radius: 50%;
    }
`

export default Outer
